const items = $input.all();

// Location and language code mappings
const locationMap = {
  'United States': 2840,
  'United Kingdom': 2826,
  'Canada': 2124,
  'Australia': 2036,
  'Germany': 2276,
  'France': 2250,
  'Spain': 2724,
  'Italy': 2380,
  'Netherlands': 2528,
  'India': 2356,
};

const languageMap = {
  'English': 'en',
  'Spanish': 'es',
  'French': 'fr',
  'German': 'de',
  'Italian': 'it',
  'Portuguese': 'pt',
  'Dutch': 'nl',
  'Russian': 'ru',
  'Chinese': 'zh',
  'Japanese': 'ja',
};

return items.map(item => {
  const body = item.json.body || {};

  const {
    target_url,
    email,
    location_name,
    language_name,
    location_code,
    language_code,
  } = body;

  let raw = (target_url || '').trim();
  let domain = '';

  try {
    const normalized = /^https?:\/\//i.test(raw) ? raw : `http://${raw}`;
    const u = new URL(normalized);
    domain = u.hostname;
  } catch (e) {
    domain = raw
      .replace(/^https?:\/\//i, '')
      .replace(/^www\./i, '')
      .split('/')[0]
      .split('?')[0]
      .trim();
  }

  const locName = location_name || 'United States';
  const langName = language_name || 'English';

  return {
    json: {
      target_url,
      email,
      domain,
      location_name: locName,
      language_name: langName,
      location_code: location_code || locationMap[locName] || 2840,
      language_code: language_code || languageMap[langName] || 'en',
    },
  };
});

console.log('\nüîç === EXTRACT COMPETITOR KEYWORDS NODE ===\n');

// ‚úÖ FIX: Get ALL inputs, not just the first one
const allInputs = $input.all();
console.log(`Processing ${allInputs.length} competitor API responses...`);

const outputKeywords = [];

for (const inputItem of allInputs) {
  const res = inputItem.json;

  // Check for API errors
  if (res.status_code && res.status_code !== 20000) {
    console.log('‚ùå API Error:', res.status_code, res.status_message);
    continue; // Skip this competitor, move to next
  }

  const result = res.tasks?.[0]?.result?.[0];
  const requestData = res.tasks?.[0]?.data || {};
  let competitorDomain = requestData.target || result?.target || 'unknown';

  if (competitorDomain !== 'unknown') {
    competitorDomain = competitorDomain
      .replace(/^https?:\/\//, '')
      .replace(/^www\./, '')
      .split('/')[0];
  }

  if (!result || !result.items) {
    console.log('‚ùå No keywords found for competitor:', competitorDomain);
    continue;
  }

  const allKeywords = result.items || [];
  console.log(`‚úÖ ${competitorDomain}: ${allKeywords.length} keywords`);

  let targetWebsiteInfo = {};
  try {
    targetWebsiteInfo = $('Extract Homepage Content').first().json || {};
  } catch (e) {
    console.log('Warning: Could not get target website info');
  }

  for (const kw of allKeywords) {
    const kd = kw.keyword_data || {};
    const keywordText = (kd.keyword || '').toLowerCase().trim();
    if (!keywordText) continue;

    const ki = kd.keyword_info || {};
    const kp = kd.keyword_properties || {};
    const ab = kd.avg_backlinks_info || {};
    const si = kd.search_intent_info || {};

    outputKeywords.push({
      json: {
        keyword: kd.keyword || '',
        search_volume: ki.search_volume || 0,
        competition: ki.competition ?? null,
        competition_level: ki.competition_level || 'UNKNOWN',
        cpc: ki.cpc ?? null,
        keyword_difficulty: kp.keyword_difficulty ?? null,
        avg_backlinks: ab.backlinks || 0,
        avg_rank: ab.rank || null,
        search_intent: si.main_intent || 'unknown',
        competitor_domain: competitorDomain,
        source: 'competitor',
        target_business_type: targetWebsiteInfo.business_type || '',
        target_services_offered: targetWebsiteInfo.services_offered || '',
        target_business_description: targetWebsiteInfo.business_description || '',
      },
    });
  }
}

console.log(`\n‚úÖ Total keywords returned across all competitors: ${outputKeywords.length}`);
return outputKeywords;

// ============================================================
// Gap Analysis: Find keywords competitors have but target doesn't
// FIXED VERSION - Correct detection of competitor vs target items
// ============================================================

console.log('\nüîç === GAP ANALYSIS NODE ===\n');

// All items from both branches (merged)
const allItems = $input.all();

console.log('1. Total items received:', allItems.length);

// Validate input - ensure we have items with json
if (!allItems || allItems.length === 0) {
  console.log('‚ùå No items received');
  return [];
}

// ‚úÖ Split into target vs competitor
// Target items: have source === 'target' and keyword field
// Competitor items: have source === 'competitor' and keyword field
const targetItems = allItems
  .filter(item => item && item.json && item.json.source === 'target' && item.json.keyword)
  .map(item => item.json);

const competitorItems = allItems
  .filter(item => item && item.json && item.json.source === 'competitor' && item.json.keyword)
  .map(item => item.json);

console.log('2. Target keywords:', targetItems.length);
console.log('3. Competitor keywords:', competitorItems.length);

// Debug: Show sample items
if (targetItems.length > 0) {
  console.log('   Sample target keyword:', targetItems[0].keyword);
}
if (competitorItems.length > 0) {
  console.log('   Sample competitor keyword:', competitorItems[0].keyword, 'from', competitorItems[0].competitor_domain);
}

// Early return if no target items or no competitor items
if (!targetItems || targetItems.length === 0) {
  console.log('‚ùå No target keywords to compare against');
  return [];
}

if (!competitorItems || competitorItems.length === 0) {
  console.log('‚ùå No competitor keywords to analyze');
  return [];
}

// Group competitor items by domain for debugging
const competitorsByDomain = {};
competitorItems.forEach(item => {
  const domain = item.competitor_domain || 'unknown';
  if (!competitorsByDomain[domain]) {
    competitorsByDomain[domain] = 0;
  }
  competitorsByDomain[domain]++;
});

console.log('4. Keywords by competitor domain:');
Object.keys(competitorsByDomain).forEach(domain => {
  console.log(`   - ${domain}: ${competitorsByDomain[domain]} keywords`);
});

// Build a set of target keywords (lowercase) for fast lookup
const targetKeywordsSet = new Set(
  targetItems
    .map(kw => {
      const keyword = (kw.keyword || '').toString().trim();
      return keyword.toLowerCase();
    })
    .filter(k => k !== '' && k !== 'null' && k !== 'undefined')
);

console.log('5. Target keywords set size:', targetKeywordsSet.size);

// If no valid target keywords, return empty
if (targetKeywordsSet.size === 0) {
  console.log('‚ùå No valid target keywords');
  return [];
}

// Get original input data
const originalInput = $('Read Input').first().json || {};

// Find gap keywords (competitor keywords not in target)
const gapKeywords = [];
const seenGaps = new Set();
let skippedDuplicates = 0;
let skippedExisting = 0;

competitorItems.forEach(kw => {
  // Validate keyword exists and is not empty
  if (!kw || !kw.keyword) return;

  const keyword = String(kw.keyword).trim();
  if (!keyword || keyword === '') return;

  const keywordLower = keyword.toLowerCase().trim();
  if (!keywordLower || keywordLower === '') return;

  // Skip if already seen
  if (seenGaps.has(keywordLower)) {
    skippedDuplicates++;
    return;
  }

  // Skip if exists in target
  if (targetKeywordsSet.has(keywordLower)) {
    skippedExisting++;
    return;
  }

  // Mark as seen and add to gap keywords
  seenGaps.add(keywordLower);

  // Build gap keyword object with proper null handling
  gapKeywords.push({
    keyword,
    search_volume: kw.search_volume ?? 0,
    competition: kw.competition ?? null,
    competition_level: kw.competition_level || 'UNKNOWN',
    cpc: kw.cpc ?? null,
    keyword_difficulty: kw.keyword_difficulty ?? null,
    avg_backlinks: kw.avg_backlinks ?? 0,
    avg_rank: kw.avg_rank ?? null,
    search_intent: kw.search_intent || 'unknown',
    competitor_domain: kw.competitor_domain || 'unknown',  // ‚ö†Ô∏è PRESERVE competitor domain
    target_domain: originalInput.domain || 'unknown',
    target_url: originalInput.target_url || '',
    email: originalInput.email || '',
  });
});

console.log('6. Gap analysis complete:');
console.log(`   - Gap keywords found: ${gapKeywords.length}`);
console.log(`   - Skipped (duplicates): ${skippedDuplicates}`);
console.log(`   - Skipped (already in target): ${skippedExisting}`);

// Group by competitor for summary
const gapsByCompetitor = {};
gapKeywords.forEach(kw => {
  const comp = kw.competitor_domain || 'unknown';
  if (!gapsByCompetitor[comp]) {
    gapsByCompetitor[comp] = 0;
  }
  gapsByCompetitor[comp]++;
});

console.log('7. Gap keywords by competitor:');
Object.keys(gapsByCompetitor).forEach(domain => {
  console.log(`   - ${domain}: ${gapsByCompetitor[domain]} gaps`);
});

// Return empty array if no gaps found (not [{}])
if (gapKeywords.length === 0) {
  console.log('‚ùå No gap keywords found\n');
  return [];
}

console.log('8. ‚úÖ Returning', gapKeywords.length, 'gap keywords to next node\n');

// Return gap keywords as n8n items
return gapKeywords.map(kw => ({ json: kw }));

// ============================================================
// FIX 3: Filter High Volume Keywords
//
// PROBLEM: The old code required avg_rank <= 20 which dropped
// ALL competitor keywords (they had ranks of 145-724).
// The OR condition (volume >= 500) rescued some but dropped low
// volume gems.
//
// FIX: Remove the rank requirement entirely for competitor keywords.
// For keyword gap analysis, rank doesn't matter ‚Äî we want ALL
// keywords competitors rank for that we DON'T rank for yet,
// regardless of their absolute position.
// Only filter by minimum search volume to avoid junk keywords.
// ============================================================

const items = $input.all();

// Minimum search volume threshold ‚Äî keep this low to capture long-tail gems
const MIN_SEARCH_VOLUME = 100;

const filtered = items
  .map(item => item.json)
  .filter(kw => {
    if (!kw || !kw.keyword) return false;

    const volume = kw.search_volume || 0;

    // Only filter out truly zero-volume keywords
    // Do NOT filter by rank ‚Äî rank doesn't matter for gap analysis
    // (we want keywords competitors rank for, regardless of position)
    return volume >= MIN_SEARCH_VOLUME;
  })
  .sort((a, b) => {
    // Sort by: search_volume DESC (best opportunities first)
    // Secondary: keyword_difficulty ASC (easier to rank for first)
    const volDiff = (b.search_volume || 0) - (a.search_volume || 0);
    if (volDiff !== 0) return volDiff;
    return (a.keyword_difficulty || 50) - (b.keyword_difficulty || 50);
  });

return filtered.map(kw => ({ json: kw }));

// ============================================================
// LLM-DRIVEN RELEVANCE: No code-based keyword filtering.
// The LLM generating the report decides which keywords are
// relevant based on business_type + services_offered from
// the Website Info node.
// TABLE: 5 columns - Keyword | Search Volume | KD | CPC (¬£) | Traffic Potential
// ============================================================

// 1) All gap keywords coming into this node
const items = $input.all();
const keywords = items.map(item => item.json || {}).filter(kw => kw && kw.keyword);

// 2) Get original input from Read Input node
const originalInput = $('Read Input').first().json || {};

// 3) Get business info from Website Info node
const websiteInfo = $('Website Info').first().json || {};
const businessType    = websiteInfo.business_type || '';
const servicesOffered = websiteInfo.services_offered || '';
const businessDesc    = websiteInfo.business_description || '';

// 4) Helper: clean a single keyword object (drop null/0 fields)
function cleanKeyword(kw) {
  const out = {
    keyword: kw.keyword,
    competitor_domain: kw.competitor_domain || undefined,
  };

  if (kw.search_volume && kw.search_volume > 0) {
    out.search_volume = kw.search_volume;
  }
  if (kw.keyword_difficulty !== null && kw.keyword_difficulty !== undefined) {
    out.keyword_difficulty = kw.keyword_difficulty;
  }
  if (kw.cpc !== null && kw.cpc !== undefined && kw.cpc > 0) {
    out.cpc = Math.round(kw.cpc * 100) / 100;
  }

  Object.keys(out).forEach(k => {
    if (out[k] === undefined || out[k] === null) delete out[k];
  });

  return out;
}

// 5) Clean all keywords (NO relevance filtering in code)
const cleanedKeywords = keywords
  .map(cleanKeyword)
  .filter(kw => Object.keys(kw).length > 1);

if (cleanedKeywords.length === 0) {
  return [{
    json: {
      message: 'No valid gap keywords found.',
      target_domain: originalInput.domain || '',
      target_url: originalInput.target_url || '',
      email: originalInput.email || '',
      report_date: new Date().toISOString(),
    },
  }];
}

// 6) Summary stats (over all keywords ‚Äî LLM will filter down)
const totalKeywords = cleanedKeywords.length;
const totalSearchVolume = cleanedKeywords.reduce((sum, kw) => sum + (kw.search_volume || 0), 0);

const difficultyKeywords = cleanedKeywords.filter(kw => kw.keyword_difficulty && kw.keyword_difficulty > 0);
const avgDifficulty = difficultyKeywords.length
  ? difficultyKeywords.reduce((sum, kw) => sum + kw.keyword_difficulty, 0) / difficultyKeywords.length
  : null;

const cpcKeywords = cleanedKeywords.filter(kw => kw.cpc && kw.cpc > 0);
const avgCpc = cpcKeywords.length
  ? cpcKeywords.reduce((sum, kw) => sum + kw.cpc, 0) / cpcKeywords.length
  : null;

const summary = {};
if (totalKeywords > 0) summary.total_gap_keywords = totalKeywords;
if (totalSearchVolume > 0) summary.total_potential_search_volume = totalSearchVolume;
if (avgDifficulty !== null) summary.average_keyword_difficulty = Math.round(avgDifficulty * 100) / 100;
if (avgCpc !== null) summary.average_cpc = Math.round(avgCpc * 100) / 100;

// 7) Group by competitor
const keywordsByCompetitor = {};
cleanedKeywords.forEach(kw => {
  const comp = kw.competitor_domain || 'Unknown';
  if (!keywordsByCompetitor[comp]) keywordsByCompetitor[comp] = [];
  keywordsByCompetitor[comp].push(kw);
});

Object.keys(keywordsByCompetitor).forEach(comp => {
  if (!keywordsByCompetitor[comp] || keywordsByCompetitor[comp].length === 0) {
    delete keywordsByCompetitor[comp];
  }
});

const competitorsAnalyzed = Object.keys(keywordsByCompetitor).length;
if (competitorsAnalyzed > 0) summary.competitors_analyzed = competitorsAnalyzed;

// 8) Build report data object
const reportData = {
  target_domain: originalInput.domain || '',
  target_url: originalInput.target_url || '',
  email: originalInput.email || '',
  business_type: businessType,
  services_offered: servicesOffered,
  business_description: businessDesc,
  report_date: new Date().toISOString(),
  summary,
  keywords_by_competitor: keywordsByCompetitor,
  keywords: cleanedKeywords,
};

// 9) Build the LLM prompt
const mdIntroLines = [
  `You are an expert SEO consultant generating a keyword gap analysis report.`,
  ``,
  `## YOUR MOST IMPORTANT TASK: RELEVANCE FILTERING`,
  `Before writing the report, you MUST filter the keywords.`,
  `The raw keyword data may contain keywords that are IRRELEVANT to this business.`,
  ``,
  `**Business Details:**`,
  `- Business Type: ${businessType}`,
  `- Services Offered: ${servicesOffered}`,
  `- Description: ${businessDesc}`,
  ``,
  `**RELEVANCE RULES ‚Äî Apply these strictly:**`,
  `‚úÖ INCLUDE a keyword if it directly relates to the business type or any of the services offered above.`,
  `‚ùå EXCLUDE a keyword if it relates to a completely different industry or service not offered by this business.`,
  ``,
  `**Examples for this business:**`,
  `‚úÖ INCLUDE: "removal company london", "man with a van", "storage near me", "packing services", "movers near me"`,
  `‚ùå EXCLUDE: "stamp duty calculator", "conveyancing solicitor", "probate", "congestion charge", "handyman london", "fensa certificate", "house valuation", "downsizing"`,
  ``,
  `Apply the same logic for ANY business type ‚Äî only include keywords that a potential customer`,
  `would search for when looking for THIS specific business or its services.`,
  ``,
  `---`,
  ``,
  `## REPORT FORMAT REQUIREMENTS`,
  ``,
  `**CRITICAL TABLE FORMAT:**`,
  `- Each keyword table MUST have EXACTLY 5 columns`,
  `- Column order MUST be: Keyword | Search Volume | KD | CPC (¬£) | Traffic Potential`,
  `- DO NOT add any other columns`,
  ``,
  `**Report Structure:**`,
  `1. Title: "# SEO Keyword Gap Analysis Report for [target_domain]"`,
  `2. Brief Introduction (2-3 sentences explaining the purpose)`,
  `3. Key Stats Summary (bullet points):`,
  `   - Total RELEVANT gap keywords included in this report`,
  `   - Total potential search volume (of relevant keywords only)`,
  `   - Average keyword difficulty`,
  `   - Average CPC`,
  `   - Number of competitors analyzed`,
  `4. **Gap Keywords by Competitor** (MOST IMPORTANT SECTION):`,
  `   - ‚ùå SKIP any competitor that has NO relevant keywords ‚Äî do NOT mention them at all`,
  `   - ONLY create a section for competitors that have at least 1 relevant keyword`,
  `   - Use this EXACT two-level heading structure:`,
  `     ## Gap Keywords by Competitor          ‚Üê main heading, written ONCE`,
  `     ### Competitor: [domain name]          ‚Üê subheading, one per competitor`,
  `   - ‚ùå DO NOT write any intro or summary sentence before the table`,
  `   - Go STRAIGHT to the keyword table immediately after the subheading`,
  `   - Keyword table sorted by search volume DESC`,
  `   - ONLY include keywords relevant to: ${businessType}`,
  `   - Use ONLY 5 columns: Keyword | Search Volume | KD | CPC (¬£) | Traffic Potential`,
  `   - If CPC is missing for a keyword, show "N/A"`,
  ``,
  `**CRITICAL - DO NOT INCLUDE:**`,
  `- ‚ùå DO NOT add "Prepared for:" anywhere`,
  `- ‚ùå DO NOT add "Prepared by:" anywhere`,
  `- ‚ùå DO NOT add "Contact:" anywhere`,
  `- ‚ùå DO NOT add any email addresses`,
  `- ‚ùå DO NOT add extra columns (only 5 columns allowed)`,
  `- ‚ùå DO NOT include irrelevant keywords in the tables`,
  `- ‚ùå DO NOT add any sentence or line before a competitor table`,
  `- ‚ùå DO NOT include competitors with zero relevant keywords`,
  `- ‚ùå DO NOT add a "Traffic Potential Explanation" section`,
  `- ‚ùå DO NOT add a "Next Steps" section`,
  `- The report MUST end after the last competitor keyword table ‚Äî nothing after that`,
  ``,
  `**Traffic Potential Calculation:**`,
  `Traffic Potential = Search Volume √ó ((100 - KD) / 100) √ó 0.3`,
  `Round to nearest whole number. If KD is 0 or missing, show "N/A".`,
  ``,
  `**Example of CORRECT format (FOLLOW THIS EXACTLY):**`,
  ``,
  `## Gap Keywords by Competitor`,
  ``,
  `### Competitor: pickfords.co.uk`,
  ``,
  `| Keyword | Search Volume | KD | CPC | Traffic Potential |`,
  `|---------|---------------|-----|---------|-------------------|`,
  `| removal company london | 8,100 | 26 | ¬£12.99 | 1,799 |`,
  `| man with a van | 22,200 | 22 | ¬£5.67 | 5,191 |`,
  ``,
  `### Competitor: anyvan.com`,
  ``,
  `| Keyword | Search Volume | KD | CPC | Traffic Potential |`,
  `|---------|---------------|-----|---------|-------------------|`,
  `| moving companies | 14,800 | 92 | ¬£11.50 | 355 |`,
  ``,
  `---`,
  ``,
  `Here is the raw keyword data (JSON). Remember to FILTER for relevance before including in tables:`,
  ``,
];

const llmPrompt =
  mdIntroLines.join('\n') +
  '\n\n```json\n' +
  JSON.stringify(reportData, null, 2) +
  '\n```' +
  '\n\n' +
  `Now generate the SEO keyword gap report in **Markdown** format.` +
  `\n\nFINAL REMINDERS:` +
  `\n- ‚úÖ FILTER keywords ‚Äî only include ones relevant to: ${businessType}` +
  `\n- ‚úÖ ONLY 5 columns: Keyword | Search Volume | KD | CPC| Traffic Potential` +
  `\n- ‚úÖ ONLY include competitors that have at least 1 relevant keyword` +
  `\n- ‚úÖ Go straight to the table after the heading ‚Äî NO intro sentence` +
  `\n- ‚úÖ Sort each table by Search Volume DESC` +
  `\n- ‚úÖ Report ends after the last competitor table ‚Äî nothing else` +
  `\n- ‚ùå NO intro/summary line before any competitor table` +
  `\n- ‚ùå NO competitors with zero relevant keywords` +
  `\n- ‚ùå NO "Traffic Potential Explanation" section` +
  `\n- ‚ùå NO "Next Steps" section` +
  `\n- ‚ùå NO "Prepared for", "Prepared by", or "Contact" sections`;

// 10) Return for next node
return [{
  json: {
    target_domain: reportData.target_domain,
    target_url: reportData.target_url,
    email: reportData.email,
    report_date: reportData.report_date,
    summary: reportData.summary,
    keywords_by_competitor: reportData.keywords_by_competitor,
    keywords: reportData.keywords,
    llm_prompt: llmPrompt,
  },
}];

// Convert LLM output to Markdown file (SEO Keyword Gap Report) - FIXED VERSION

// 1) Get markdown text from LLM output (first item)
const llmItem = $input.first().json || {};
const markdown = llmItem.text || llmItem.markdown || '# Empty report\n';

// 2) Extract website from multiple possible sources
let website = 'website'; // default fallback

// Method 1: Try to get from "Read Input" node (primary source)
try {
  const readInput = $('Read Input');
  if (readInput && readInput.first()) {
    const inputData = readInput.first().json || {};
    // Check for domain first (cleaner), then target_url, then other fields
    website = inputData.domain || 
              inputData.target_url || 
              inputData.target_domain || 
              inputData.target || 
              inputData.website || 
              website;

    // If target_url contains http:// or https://, extract just the domain
    if (website && website.includes('://')) {
      website = website.replace(/https?:\/\//i, '').replace(/^www\./i, '').split('/')[0];
    }
  }
} catch (e) {
  // Node doesn't exist, continue to other methods
}

// Method 2: Try to get from "Report Generator" node (if it exists)
if (website === 'website') {
  try {
    const reportGenerator = $('Report Generator');
    if (reportGenerator && reportGenerator.first()) {
      const reportData = reportGenerator.first().json || {};
      website = reportData.target_domain || reportData.target_url || reportData.target || reportData.website || website;
    }
  } catch (e) {
    // Node doesn't exist, continue to other methods
  }
}

// Optional date range
let dateFrom = '';
let dateTo = '';

try {
  const reportGenerator = $('Report Generator');
  if (reportGenerator && reportGenerator.first()) {
    const reportData = reportGenerator.first().json || {};
    dateFrom = reportData.date_from || reportData.dateFrom || '';
    dateTo = reportData.date_to || reportData.dateTo || '';
  }
} catch (e) {
  // Node doesn't exist, use empty strings
}

// Current date for filename and metadata
const date = new Date().toISOString().split('T')[0];

// 3) Clean website string for safe filename
const cleanWebsite = String(website)
  .replace(/https?:\/\//i, '')
  .replace(/^www\./i, '')
  .replace(/[^a-zA-Z0-9]/g, '_')
  .replace(/_+/g, '_')
  .replace(/^_+|_+$/g, '');

// 4) Filename pattern: SEO Keyword Gap Report_<website>_<date>.md
const filename = `SEO Keyword Gap Report_${cleanWebsite || 'website'}_${date}.md`;

// 5) Convert markdown text to base64 for binary
const base64Content = Buffer.from(markdown, 'utf8').toString('base64');

// 6) Return JSON + binary so n8n can write the file
return {
  json: {
    filename,
    targetWebsite: website,
    generatedAt: date,
    dateFrom,
    dateTo,
    markdownContent: markdown,
  },
  binary: {
    data: {
      data: base64Content,
      mimeType: 'text/markdown',
      fileName: filename,
      fileExtension: 'md',
    },
  },
};

const res = $input.first().json || {};
return [{
  json: {
    error: true,       
    status_code: res.status_code,
    status_message: res.status_message || 'Unknown error',
    raw: res,
  },
}];

// Website information - can be extended via input or use LLM to classify
// For now, use a basic database but allow override from input
const websiteInfo = {
  'delta-solution.co.uk': {
    business_type: 'Moving and Relocation Services',
    services_offered: 'moving services, home relocation, residential removals, corporate relocations, commercial moving, storage and moving, packing services, furniture installation, home staging',
    description: 'Movers that move things from one place to another'
  },
  'bubblescarspa.com': {
    business_type: 'Car Washing Services',
    services_offered: 'car wash, hand car wash, car detailing, interior cleaning, exterior cleaning, vehicle cleaning, car valeting',
    description: 'Car washing services'
