  const inputJson = item.json || {};
  const llmResponse = inputJson.text || inputJson.response || inputJson.output || '';

  if (!llmResponse) {
    results.push({
      json: {
        keyword: '',
        source: 'target',
        target_domain: inputJson.target_domain || 'unknown',
        llm_filter_decision: false,
        llm_filter_reason: 'No LLM response text',
        has_empty_keyword: true,
      },
    });
    continue;
  }

  let llmData = null;

  if (typeof llmResponse === 'string') {
    try {
      llmData = JSON.parse(llmResponse);
    } catch (e) {
      try {
        let cleaned = llmResponse.trim();
        cleaned = cleaned
          .replace(/```json/gi, '')
          .replace(/```/g, '')
          .trim();
        const jsonMatch = cleaned.match(/\{[\s\S]*\}/);
        if (jsonMatch) {
          llmData = JSON.parse(jsonMatch[0]);
        }
      } catch (e2) {
        llmData = null;
      }
    }
  } else {
    try {
      llmData = typeof llmResponse === 'object'
        ? llmResponse
        : JSON.parse(JSON.stringify(llmResponse));
    } catch (e) {
      llmData = null;
    }
  }

  if (!llmData || typeof llmData !== 'object') {
    results.push({
      json: {
        keyword: '',
        source: 'target',
        target_domain: inputJson.target_domain || 'unknown',
        llm_raw: llmResponse,
        llm_filter_decision: false,
        llm_filter_reason: 'Failed to parse LLM JSON',
        has_empty_keyword: true,
      },
    });
    continue;
  }

  const keepFlag =
    llmData.keep === true ||
    llmData.keep === 'true' ||
    llmData.keep === 1;

  const reason = llmData.reason || 'LLM decision';
  const keyword = llmData.keyword ?? '';
  const hasEmptyKeyword = !keyword.trim();

  const keywordData = {
    // Core keyword fields
    keyword: keyword,
    search_volume: llmData.search_volume ?? 0,
    competition: llmData.competition ?? null,
    competition_level: llmData.competition_level || 'UNKNOWN',
    cpc: llmData.cpc ?? null,
