    homepage_key_paragraphs: llmData.homepage_key_paragraphs || '',
    homepage_services_list: llmData.homepage_services_list || '',
    // LLM filter decision metadata
    llm_filter_decision: keepFlag,
    llm_filter_reason: reason,
    // NEW: flag empty keywords instead of silently dropping them
    has_empty_keyword: hasEmptyKeyword,
  };

  // CHANGED: output all items, but flag empty-keyword ones
  // so downstream nodes can filter them out if needed.
  // Previously this block did `continue` which caused zero output
  // when ALL upstream keywords were empty (as is the case here).
  results.push({ json: keywordData });
}

