// ============================================================
// Extract Top 10 Target Keywords from API Response
// Strategy: Prioritize High Search Volume + Low CPC
// ============================================================

const res = $input.first().json;

// Get the keywords array from DataForSEO response
const result = res.tasks?.[0]?.result;
const keywords = Array.isArray(result) ? result : [];

if (keywords.length === 0) {
  console.log('‚ùå No keywords found in API response');
  return [];
}

console.log(`üìä Total keywords received: ${keywords.length}`);

// Filter out keywords with no search volume or invalid data
const validKeywords = keywords.filter(kw => {
  return kw.keyword && 
         kw.search_volume && 
         kw.search_volume > 0 &&
         typeof kw.cpc === 'number';
});

console.log(`‚úÖ Valid keywords after filtering: ${validKeywords.length}`);

if (validKeywords.length === 0) {
  console.log('‚ùå No valid keywords with search volume and CPC data');
  return [];
}

// Sort keywords by value score
// Formula: search_volume / (cpc + 1)
// Higher score = Better keyword (high volume + low cost)
const sortedKeywords = validKeywords.sort((a, b) => {
  // Calculate value score: search volume divided by CPC
  // Add 1 to CPC to avoid division by zero
  const scoreA = a.search_volume / (a.cpc + 1);
  const scoreB = b.search_volume / (b.cpc + 1);

  // Sort by score descending (higher is better)
  return scoreB - scoreA;
});

// Take top 10 keywords
const top10Keywords = sortedKeywords.slice(0, 20);

console.log('\nüèÜ TOP 10 KEYWORDS SELECTED:');
console.log('============================================');
top10Keywords.forEach((kw, index) => {
  const score = (kw.search_volume / (kw.cpc + 1)).toFixed(2);
  console.log(`${index + 1}. "${kw.keyword}"`);
  console.log(`   Volume: ${kw.search_volume} | CPC: $${kw.cpc} | Competition: ${kw.competition || 'N/A'} | Score: ${score}`);
  console.log('--------------------------------------------');
});

// Map to output format
const output = top10Keywords.map(kw => ({
  json: {
    keyword: kw.keyword,
    search_volume: kw.search_volume,
    competition: kw.competition || 'UNKNOWN',
    cpc: kw.cpc,
    location_code: kw.location_code,
    language_code: kw.language_code,
    competition_index: kw.competition_index,
    value_score: parseFloat((kw.search_volume / (kw.cpc + 1)).toFixed(2))
  }
}));

console.log(`\n‚úÖ Successfully extracted ${output.length} top keywords for filtering`);
console.log(`üì§ Sending to Filter Keywords node...\n`);

return output;

// ============================================================
// Prepare Competitors API Request
// Collect all keywords into a single array for API call
// ============================================================

const items = $input.all();

if (!items || items.length === 0) {
  console.log('‚ùå No keywords received');
  return [];
}

// Extract just the keyword strings from all items
const keywords = items
  .map(item => item.json.keyword)
  .filter(kw => kw && kw.trim() !== '');

// Get location and language from first item (should be same for all)
const firstItem = items[0].json;
const locationCode = firstItem.location_code || 2826;
const languageCode = firstItem.language_code || 'en';

console.log(`üìä Collected ${keywords.length} keywords for competitor analysis:`);
console.log(keywords.join(', '));

// Return single item with all keywords
return [{
  json: {
    keywords: keywords,
    location_code: locationCode,
    language_code: languageCode,
    total_keywords: keywords.length
  }
}];

// Clean Competitor Domains
const items = $input.all();

const output = items.map(item => {
  let domain = item.json.competitor_domain || '';

  // Remove protocol (http://, https://)
  domain = domain.replace(/^https?:\/\//, '');

  // Remove www.
  domain = domain.replace(/^www\./, '');

  // Remove any path after domain
  domain = domain.split('/')[0];

  return {
    json: {
      ...item.json,
      competitor_domain: domain
    }
  };
});

console.log(`‚úÖ Cleaned ${output.length} competitor domains`);
return output;
